from datetime import datetime, timedelta

def is_admin():
    try:
        return ctypes.windll.shell32.IsUserAnAdmin() != 0
    except:
        return False

def elevate_and_run_script():
    # Only elevate if we're not already admin
    if is_admin():
        return

    script_path = os.path.abspath(sys.argv[0])

    # schedule a time 1 minute in the future to avoid ‚Äúpast‚Äù warnings
    start_time = (datetime.now() + timedelta(minutes=1)).strftime("%H:%M")

    try:
        # Delete any existing task with the same name to avoid duplicates
        subprocess.run(['schtasks', '/delete', '/tn', 'ElevateScript', '/f'], check=True)

        # Create the task
        subprocess.run(
            f'schtasks /create /tn "ElevateScript" /tr "{sys.executable} {script_path}" '
            f'/sc once /st {start_time} /rl highest /f',
            check=True, shell=True
        )

        # Run the task immediately
        subprocess.run(['schtasks', '/run', '/tn', 'ElevateScript'], check=True)

        # Exit this non‚Äëelevated process
        sys.exit(0)
    except subprocess.CalledProcessError:
        # If anything goes wrong, just continue (so you don't block your own script)
        pass

